css:
.go-debug-btn-flat.btn {
  border: none;
  border-radius: 0;
  background: none;
  box-shadow: none;
  width: auto;
  height: auto;
  line-height: normal;
  padding: 0;
}
.go-debug-breakpoint {
  display: inline-block;
  height: 0.8em !important;
  width: 0.8em;
  border-radius: 50%;
  border: 1px solid currentColor;
  color: red;
}
.go-debug-breakpoint-state-valid {
  background-color: currentColor;
}
.go-debug-breakpoint-state-error {
  border-color: orange;
  background-color: orange;
}
atom-text-editor .go-debug-gutter-breakpoint {
  width: 100%;
  display: flex;
  align-items: center;
  cursor: pointer;
}
atom-text-editor .go-debug-line {
  background: rgba(64, 115, 255, 0.5) !important;
}
.go-debug-panel {
  display: flex;
  flex-direction: column;
  flex: 1;
  position: relative;
}
.go-debug-panel-resizer {
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  width: 5px;
  cursor: col-resize;
}
.go-debug-panel-title.panel-heading {
  text-align: center;
  background-color: #202020;
}
.go-debug-panel-configs {
  display: flex;
  align-items: stretch;
}
.go-debug-panel-configs > * {
  height: 100%;
}
.go-debug-panel-configs .go-debug-btn-flat {
  width: 3em;
}
.go-debug-panel-configs select {
  background: #202020;
  flex: 1;
  border: 0;
  cursor: pointer;
}
.go-debug-panel-commands {
  display: flex;
  flex-shrink: 0;
  white-space: nowrap;
}
.go-debug-panel-commands > .btn {
  flex: 1;
}
.go-debug-panel-configs,
.go-debug-panel-commands {
  height: 3em;
  border-bottom: 1px solid #181818;
}
.go-debug-panel-content {
  overflow: auto;
  flex: 1;
}
.go-debug-panel-stacktrace,
.go-debug-panel-goroutines {
  white-space: nowrap;
  text-overflow: ellipsis;
}
.go-debug-panel-stacktrace > *,
.go-debug-panel-goroutines > * {
  padding: 0.2em 0.5em;
  cursor: pointer;
}
.go-debug-panel-stacktrace > *:nth-child(odd),
.go-debug-panel-goroutines > *:nth-child(odd) {
  background-color: rgba(0, 0, 0, 0.1);
}
.go-debug-panel-stacktrace > *:hover,
.go-debug-panel-goroutines > *:hover {
  background-color: rgba(0, 0, 0, 0.2);
}
.go-debug-panel-variables {
  padding: 2.5px;
}
.go-debug-panel-variables li > div {
  display: flex;
}
.go-debug-panel-variables li > div > .go-debug-icon {
  margin-right: 5px;
}
.go-debug-panel-variables ol {
  overflow: visible;
  margin: 0;
  padding: 0;
  white-space: pre;
  list-style: none;
}
.go-debug-panel-variables ol ol {
  padding-left: 10px;
}
.go-debug-watch-expression-input {
  display: flex;
  padding: 0 0.2em;
}
.go-debug-watch-expression-input > .go-debug-text-input {
  flex: 1;
}
.go-debug-panel-watch-expressions-variables {
  padding: 2.5px;
  overflow-x: auto;
}
.go-debug-panel-watch-expressions-variables > div {
  display: flex;
}
.go-debug-panel-watch-expressions-variables > div > .go-debug-btn-flat {
  align-self: flex-start;
}
.go-debug-panel-watch-expressions-variables > div > .go-debug-panel-variables {
  flex: 1;
}
.go-debug-panel-breakpoints > * {
  padding: 0.2em 0.2em 0;
  cursor: pointer;
  white-space: nowrap;
  display: flex;
  align-items: baseline;
}
.go-debug-panel-breakpoints .go-debug-btn-flat {
  margin-right: 5px;
  flex-shrink: 0;
}
.go-debug-panel-breakpoints .go-debug-breakpoint {
  margin-right: 5px;
  flex-shrink: 0;
}
.go-debug-panel-stacktrace-empty,
.go-debug-panel-goroutines-empty,
.go-debug-panel-variables-empty,
.go-debug-panel-watch-expressions-empty,
.go-debug-panel-breakpoints-empty {
  vertical-align: middle;
  text-align: center;
  padding: 5px;
}
.go-debug-output {
  flex: 1;
  display: flex;
  margin: -10px;
  /* revert padding of panel-body in go-plus */
}
.go-debug-output-sidebar {
  flex-shrink: 0;
  border-right: 1px solid #181818;
}
.go-debug-output-sidebar > * {
  min-width: 3em;
  min-height: 3em;
}
.go-debug-output-content {
  flex: 1;
  flex-direction: column;
  display: flex;
}
.go-debug-output-content .output {
  flex: 1;
  white-space: pre-wrap;
  padding: 10px;
  /* same as in go-plus */
  overflow: auto;
  word-break: break-all;
}
.go-debug-output-content .dlvspawnoptions-indent {
  padding-left: 2em;
}
.go-plus-panel.is-vertical .go-debug-output {
  flex-direction: column;
}
.go-plus-panel.is-vertical .go-debug-output-sidebar {
  border-right: 0;
  border-bottom: 1px solid #181818;
}
.go-debug-expandable-header.panel-heading {
  padding: 5px;
  border-bottom: 1px solid #181818;
  cursor: pointer;
  font-size: inherit;
}
.go-debug-expandable-header.panel-heading .go-debug-icon {
  margin-right: 5px;
}
.go-debug-expandable-body {
  overflow-x: auto;
}
.go-debug-expandable[data-expanded="false"] .go-debug-expandable-body {
  display: none;
}
.go-debug-expandable[data-expanded="true"] + .go-debug-expandable .go-debug-expandable-header {
  border-top: 1px solid #181818;
}
.go-debug-icon.icon {
  display: inline-block;
  cursor: pointer;
  text-align: center;
  width: 1.5em;
  flex-shrink: 0;
}
.go-debug-icon.icon::before {
  width: auto;
  height: auto;
  font-size: inherit;
  margin: 0;
}
.go-debug-toggle-hidden {
  visibility: hidden;
}
.go-debug-text-input > input {
  padding: 3.33333333px;
  color: #dbdbdb;
  border: 1px solid #181818;
  background-color: #191919;
  width: 100%;
}
